    "High Speed Digitizer for Remote Sensing Project",nt"tracking_summary": {ntt"total":
    7,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:50:42.154912",nt"name": "high-speed-digitizer-for-remote-sensing-project",nt"isopen":
    true,nt"url": null,nt"notes": "Alphacore, Inc. proposes to design and characterize
    a 24Gsps (giga-samples per-second), 6-bit, low-power, and low-cost analog-to-digital
    converter (ADC) for use in a wide range of NASA's microwave sensor based remote
    sensing applications.  The goal of this program is to provide an ultra-high-speed,
    low-power ADC that does both, provides excellent interfacing capabilities to top
    FPGAs and also has an optimized low-power spectrometer DSP backend available to
    be integrated on the same chip. The proposed ADC employs an innovative topology
    with high-bandwidth front-end sampling circuit combined with a flash-type ADC and
    encoder circuitry that simplifies FPGA interfacing. Innovative and effective digital
    calibration is used to guarantee spurious free Nyquist frequency band which is an
    important requirement in remote sensing applications.Comparable commercial ADCs
    are based on expensive and power-hungry bipolar transistor technologies such as
    indium phosphide (InP), gallium arsenide (GaAs) and silicon germanium (SiGe). Alphacore
    designs take advantage of the latest low-power, high-speed digital CMOS processes,
    resulting in ADC power consumption that is less than 1/8 of the power consumption
    of competitor ADCs. Using a CMOS process provides additional advantages in that
    we can leverage existing intellectual property (IP) to enhance the system-level
    integration of the ADC, e.g., on-chip digital calibration logic, data buffer memory,
    high-speed transceiver logic, and direct on-chip DSP capabilities.",nt"license_title":
